import React from 'react';
import './NavBar.css';

const NavBar: React.FC = () => {
  return (
    <div className="NavBar">
      <h1>Lynette's Skin Studio</h1>
      <ul>
          <a>Home</a>
      </ul>
    </div>
  );
}

export default NavBar;
